import React from "react";
import UserItem from "./UserItem/UserItem";

const userList = props => {
    let users = [];
    for (let i = 0; i < 5; ++i) {
        users.push(
            <UserItem
                key={i}
                source="https://www.kindpng.com/picc/m/269-2697881_computer-icons-user-clip-art-transparent-png-icon.png"
                name="SampleName"
                age="43"
                country="Ukraine"
                status="user"
            />
        );
    }

    return <div>{users}</div>;
};

export default userList;
